@Override
public int advance(int target) throws IOException {
  if (bufferLength == 0 || docs[bufferLength - 1] < target) {
    refill(target);
  }

  i = Arrays.binarySearch(docs, i + 1, bufferLength, target);
  if (i < 0) {
    i = -1 - i;
  }
  if (i == bufferLength) {
    return doc = DocIdSetIterator.NO_MORE_DOCS;
  }
  return doc = docs[i];
}

